    false,nt"url": null,nt"notes": "This narrative report for Fort Niobrara
    National Wildlife Refuge outlines Refuge accomplishments for the 1989 calendar year.
    The report begins by giving Refuge highlights and describing the climate and habitat
    conditions in the Refuge, as well as land acquisition, personnel, youth programs,
    funding, safety, and technical assistance. The habitat management section discusses
    forests, grasslands, grazing, haying, fire management, pest control, and wilderness
    and special areas. Wildlife- including wildlife diversity, endangered and threatened
    species, migratory birds, upland game birds, big game animals, fisheries resources,
    surplus animal disposal, animal control, marking and banding, and disease prevention
    and control- are discussed. The public relations section discusses information and
    interpretation, recreational uses, law enforcement, and cooperative associations.
    The construction and maintenance section describes new construction, rehabilitation,
    maintenance, equipment utilization and replacement, and energy conservation. Items
    of interest are discussed. Photographs and brochures are attached.",nt"owner_org":
